EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''99493'',''SBSQ PSYC COLLAB CARE MGMT'',''SUBSEQUENT PSYCHIATRIC COLLABORATIVE CARE MANAGEMENT, FIRST 60 MINUTES IN A SUBSEQUENT MONTH OF BEHAVIORAL HEALTH CARE MANAGER ACTIVITIES, IN CONSULTATION WITH A PSYCHIATRIC CONSULTANT, AND DIRECTED BY THE TREATING PHYSICIAN OR OTHER QUALIFIED HEALTH CARE PROFESSIONAL, WITH THE FOLLOWING REQUIRED ELEMENTS: TRACKING PATIENT FOLLOW-UP AND PROGRESS USING THE REGISTRY, WITH APPROPRIATE DOCUMENTATION, PARTICIPATION IN WEEKLY CASELOAD CONSULTATION WITH THE PSYCHIATRIC CONSULTANT, ONGOING COLLABORATION WITH AND COORDINATION OF THE PATIENT''''S MENTAL HEALTH CARE WITH THE TREATING PHYSICIAN OR OTHER QUALIFIED HEALTH CARE PROFESSIONAL AND ANY OTHER TREATING MENTAL HEALTH PROVIDERS, ADDITIONAL REVIEW OF PROGRESS AND RECOMMENDATIONS FOR CHANGES IN TREATMENT, AS INDICATED, INCLUDING MEDICATIONS, BASED ON RECOMMENDATIONS PROVIDED BY THE PSYCHIATRIC CONSULTANT, PROVISION OF BRIEF INTERVENTIONS USING EVIDENCE-BASED TECHNIQUES SUCH AS BEHAVIORAL ACTIVATION, MOTIVATIONAL INTERVIEWING, AND OTHER FOCUSED TREATMENT STRATEGIES, MONITORING OF PATIENT OUTCOMES USING VALIDATED RATING SCALES, AND RELAPSE PREVENTION PLANNING WITH PATIENTS AS THEY ACHIEVE REMISSION OF SYMPTOMS AND/OR OTHER TREATMENT GOALS AND ARE PREPARED FOR DISCHARGE FROM ACTIVE TREATMENT.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''99492'',''1ST PSYC COLLAB CARE MGMT'',''INITIAL PSYCHIATRIC COLLABORATIVE CARE MANAGEMENT, FIRST 70 MINUTES IN THE FIRST CALENDAR MONTH OF BEHAVIORAL HEALTH CARE MANAGER ACTIVITIES, IN CONSULTATION WITH A PSYCHIATRIC CONSULTANT, AND DIRECTED BY THE TREATING PHYSICIAN OR OTHER QUALIFIED HEALTH CARE PROFESSIONAL, WITH THE FOLLOWING REQUIRED ELEMENTS: OUTREACH TO AND ENGAGEMENT IN TREATMENT OF A PATIENT DIRECTED BY THE TREATING PHYSICIAN OR OTHER QUALIFIED HEALTH CARE PROFESSIONAL, INITIAL ASSESSMENT OF THE PATIENT, INCLUDING ADMINISTRATION OF VALIDATED RATING SCALES, WITH THE DEVELOPMENT OF AN INDIVIDUALIZED TREATMENT PLAN, REVIEW BY THE PSYCHIATRIC CONSULTANT WITH MODIFICATIONS OF THE PLAN IF RECOMMENDED, ENTERING PATIENT IN A REGISTRY AND TRACKING PATIENT FOLLOW-UP AND PROGRESS USING THE REGISTRY, WITH APPROPRIATE DOCUMENTATION, AND PARTICIPATION IN WEEKLY CASELOAD CONSULTATION WITH THE PSYCHIATRIC CONSULTANT, AND PROVISION OF BRIEF INTERVENTIONS USING EVIDENCE-BASED TECHNIQUES SUCH AS BEHAVIORAL ACTIVATION, MOTIVATIONAL INTERVIEWING, AND OTHER FOCUSED TREATMENT STRATEGIES.'')';
