EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''99483'',''ASSMT & CARE PLN PT COG IMP'',''ASSESSMENT OF AND CARE PLANNING FOR A PATIENT WITH COGNITIVE IMPAIRMENT, REQUIRING AN INDEPENDENT HISTORIAN, IN THE OFFICE OR OTHER OUTPATIENT, HOME OR DOMICILIARY OR REST HOME, WITH ALL OF THE FOLLOWING REQUIRED ELEMENTS: COGNITION-FOCUSED EVALUATION INCLUDING A PERTINENT HISTORY AND EXAMINATION, MEDICAL DECISION MAKING OF MODERATE OR HIGH COMPLEXITY, FUNCTIONAL ASSESSMENT (EG, BASIC AND INSTRUMENTAL ACTIVITIES OF DAILY LIVING), INCLUDING DECISION-MAKING CAPACITY, USE OF STANDARDIZED INSTRUMENTS FOR STAGING OF DEMENTIA (EG, FUNCTIONAL ASSESSMENT STAGING TEST [FAST], CLINICAL DEMENTIA RATING [CDR]), MEDICATION RECONCILIATION AND REVIEW FOR HIGH-RISK MEDICATIONS, EVALUATION FOR NEUROPSYCHIATRIC AND BEHAVIORAL SYMPTOMS, INCLUDING DEPRESSION, INCLUDING USE OF STANDARDIZED SCREENING INSTRUMENT(S), EVALUATION OF SAFETY (EG, HOME), INCLUDING MOTOR VEHICLE OPERATION, IDENTIFICATION OF CAREGIVER(S), CAREGIVER KNOWLEDGE, CAREGIVER NEEDS, SOCIAL SUPPORTS, AND THE WILLINGNESS OF CAREGIVER TO TAKE ON CAREGIVING TASKS, DEVELOPMENT, UPDATING OR REVISION, OR REVIEW OF AN ADVANCE CARE PLAN, CREATION OF A WRITTEN CARE PLAN, INCLUDING INITIAL PLANS TO ADDRESS ANY NEUROPSYCHIATRIC SYMPTOMS, NEURO-COGNITIVE SYMPTOMS, FUNCTIONAL LIMITATIONS, AND REFERRAL TO COMMUNITY RESOURCES AS NEEDED (EG, REHABILITATION SERVICES, ADULT DAY PROGRAMS, SUPPORT GROUPS) SHARED WITH THE PATIENT AND/OR CAREGIVER WITH INITIAL EDUCATION AND SUPPORT. TYPICALLY, 60 MINUTES OF TOTAL TIME IS SPENT ON THE DATE OF THE ENCOUN'')';
