EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''99337'',''DOMICIL/R-HOME VISIT EST PAT'',''DOMICILIARY OR REST HOME VISIT FOR THE EVALUATION AND MANAGEMENT OF AN ESTABLISHED PATIENT, WHICH REQUIRES AT LEAST 2 OF THESE 3 KEY COMPONENTS: A COMPREHENSIVE INTERVAL HISTORY; A COMPREHENSIVE EXAMINATION; MEDICAL DECISION MAKING OF MODERATE TO HIGH COMPLEXITY. COUNSELING AND/OR COORDINATION OF CARE WITH OTHER PHYSICIANS, OTHER QUALIFIED HEALTH CARE PROFESSIONALS, OR AGENCIES ARE PROVIDED CONSISTENT WITH THE NATURE OF THE PROBLEM(S) AND THE PATIENT''''S AND/OR FAMILY''''S NEEDS. USUALLY, THE PRESENTING PROBLEM(S) ARE OF MODERATE TO HIGH SEVERITY. THE PATIENT MAY BE UNSTABLE OR MAY HAVE DEVELOPED A SIGNIFICANT NEW PROBLEM REQUIRING IMMEDIATE PHYSICIAN ATTENTION. TYPICALLY, 60 MINUTES ARE SPENT WITH THE PATIENT AND/OR FAMILY OR CAREGIVER.'')';
