EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97172'',''ATHLETIC TRN RE-EVAL PLAN CR'',''RE-EVALUATION OF ATHLETIC TRAINING ESTABLISHED PLAN OF CARE REQUIRING THESE COMPONENTS: AN ASSESSMENT OF PATIENT''''S CURRENT FUNCTIONAL STATUS WHEN THERE IS A DOCUMENTED CHANGE; AND A REVISED PLAN OF CARE USING A STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME WITH AN UPDATE IN MANAGEMENT OPTIONS, GOALS, AND INTERVENTIONS. TYPICALLY, 20 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97171'',''ATHLETIC TRN EVAL HIGH CMPLX'',''ATHLETIC TRAINING EVALUATION, HIGH COMPLEXITY, REQUIRING THESE COMPONENTS: A MEDICAL HISTORY AND PHYSICAL ACTIVITY PROFILE, WITH 3 OR MORE COMORBIDITIES THAT AFFECT PHYSICAL ACTIVITY; A COMPREHENSIVE EXAMINATION OF BODY SYSTEMS USING STANDARDIZED TESTS AND MEASURES ADDRESSING A TOTAL OF 4 OR MORE ELEMENTS FROM ANY OF THE FOLLOWING: BODY STRUCTURES, PHYSICAL ACTIVITY, AND/OR PARTICIPATION DEFICIENCIES; CLINICAL PRESENTATION WITH UNSTABLE AND UNPREDICTABLE CHARACTERISTICS; AND CLINICAL DECISION MAKING OF HIGH COMPLEXITY USING STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME. TYPICALLY, 45 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97170'',''ATHLETIC TRN EVAL MOD CMPLX'',''ATHLETIC TRAINING EVALUATION, MODERATE COMPLEXITY, REQUIRING THESE COMPONENTS: A MEDICAL HISTORY AND PHYSICAL ACTIVITY PROFILE WITH 1-2 COMORBIDITIES THAT AFFECT PHYSICAL ACTIVITY; AN EXAMINATION OF AFFECTED BODY AREA AND OTHER SYMPTOMATIC OR RELATED SYSTEMS ADDRESSING A TOTAL OF 3 OR MORE ELEMENTS FROM ANY OF THE FOLLOWING: BODY STRUCTURES, PHYSICAL ACTIVITY, AND/OR PARTICIPATION DEFICIENCIES; AND CLINICAL DECISION MAKING OF MODERATE COMPLEXITY USING STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME. TYPICALLY, 30 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97169'',''ATHLETIC TRN EVAL LOW CMPLX'',''ATHLETIC TRAINING EVALUATION, LOW COMPLEXITY, REQUIRING THESE COMPONENTS: A HISTORY AND PHYSICAL ACTIVITY PROFILE WITH NO COMORBIDITIES THAT AFFECT PHYSICAL ACTIVITY; AN EXAMINATION OF AFFECTED BODY AREA AND OTHER SYMPTOMATIC OR RELATED SYSTEMS ADDRESSING 1-2 ELEMENTS FROM ANY OF THE FOLLOWING: BODY STRUCTURES, PHYSICAL ACTIVITY, AND/OR PARTICIPATION DEFICIENCIES; AND CLINICAL DECISION MAKING OF LOW COMPLEXITY USING STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME. TYPICALLY, 15 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97168'',''OT RE-EVAL EST PLAN CARE'',''RE-EVALUATION OF OCCUPATIONAL THERAPY ESTABLISHED PLAN OF CARE, REQUIRING THESE COMPONENTS: AN ASSESSMENT OF CHANGES IN PATIENT FUNCTIONAL OR MEDICAL STATUS WITH REVISED PLAN OF CARE; AN UPDATE TO THE INITIAL OCCUPATIONAL PROFILE TO REFLECT CHANGES IN CONDITION OR ENVIRONMENT THAT AFFECT FUTURE INTERVENTIONS AND/OR GOALS; AND A REVISED PLAN OF CARE. A FORMAL REEVALUATION IS PERFORMED WHEN THERE IS A DOCUMENTED CHANGE IN FUNCTIONAL STATUS OR A SIGNIFICANT CHANGE TO THE PLAN OF CARE IS REQUIRED. TYPICALLY, 30 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97167'',''OT EVAL HIGH COMPLEX 60 MIN'',''OCCUPATIONAL THERAPY EVALUATION, HIGH COMPLEXITY, REQUIRING THESE COMPONENTS: AN OCCUPATIONAL PROFILE AND MEDICAL AND THERAPY HISTORY, WHICH INCLUDES REVIEW OF MEDICAL AND/OR THERAPY RECORDS AND EXTENSIVE ADDITIONAL REVIEW OF PHYSICAL, COGNITIVE, OR PSYCHOSOCIAL HISTORY RELATED TO CURRENT FUNCTIONAL PERFORMANCE; AN ASSESSMENT(S) THAT IDENTIFIES 5 OR MORE PERFORMANCE DEFICITS (IE, RELATING TO PHYSICAL, COGNITIVE, OR PSYCHOSOCIAL SKILLS) THAT RESULT IN ACTIVITY LIMITATIONS AND/OR PARTICIPATION RESTRICTIONS; AND CLINICAL DECISION MAKING OF HIGH ANALYTIC COMPLEXITY, WHICH INCLUDES AN ANALYSIS OF THE PATIENT PROFILE, ANALYSIS OF DATA FROM COMPREHENSIVE ASSESSMENT(S), AND CONSIDERATION OF MULTIPLE TREATMENT OPTIONS. PATIENT PRESENTS WITH COMORBIDITIES THAT AFFECT OCCUPATIONAL PERFORMANCE. SIGNIFICANT MODIFICATION OF TASKS OR ASSISTANCE (EG, PHYSICAL OR VERBAL) WITH ASSESSMENT(S) IS NECESSARY TO ENABLE PATIENT TO COMPLETE EVALUATION COMPONENT. TYPICALLY, 60 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97166'',''OT EVAL MOD COMPLEX 45 MIN'',''OCCUPATIONAL THERAPY EVALUATION, MODERATE COMPLEXITY, REQUIRING THESE COMPONENTS: AN OCCUPATIONAL PROFILE AND MEDICAL AND THERAPY HISTORY, WHICH INCLUDES AN EXPANDED REVIEW OF MEDICAL AND/OR THERAPY RECORDS AND ADDITIONAL REVIEW OF PHYSICAL, COGNITIVE, OR PSYCHOSOCIAL HISTORY RELATED TO CURRENT FUNCTIONAL PERFORMANCE; AN ASSESSMENT(S) THAT IDENTIFIES 3-5 PERFORMANCE DEFICITS (IE, RELATING TO PHYSICAL, COGNITIVE, OR PSYCHOSOCIAL SKILLS) THAT RESULT IN ACTIVITY LIMITATIONS AND/OR PARTICIPATION RESTRICTIONS; AND CLINICAL DECISION MAKING OF MODERATE ANALYTIC COMPLEXITY, WHICH INCLUDES AN ANALYSIS OF THE OCCUPATIONAL PROFILE, ANALYSIS OF DATA FROM DETAILED ASSESSMENT(S), AND CONSIDERATION OF SEVERAL TREATMENT OPTIONS. PATIENT MAY PRESENT WITH COMORBIDITIES THAT AFFECT OCCUPATIONAL PERFORMANCE. MINIMAL TO MODERATE MODIFICATION OF TASKS OR ASSISTANCE (EG, PHYSICAL OR VERBAL) WITH ASSESSMENT(S) IS NECESSARY TO ENABLE PATIENT TO COMPLETE EVALUATION COMPONENT. TYPICALLY, 45 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97165'',''OT EVAL LOW COMPLEX 30 MIN'',''OCCUPATIONAL THERAPY EVALUATION, LOW COMPLEXITY, REQUIRING THESE COMPONENTS: AN OCCUPATIONAL PROFILE AND MEDICAL AND THERAPY HISTORY, WHICH INCLUDES A BRIEF HISTORY INCLUDING REVIEW OF MEDICAL AND/OR THERAPY RECORDS RELATING TO THE PRESENTING PROBLEM; AN ASSESSMENT(S) THAT IDENTIFIES 1-3 PERFORMANCE DEFICITS (IE, RELATING TO PHYSICAL, COGNITIVE, OR PSYCHOSOCIAL SKILLS) THAT RESULT IN ACTIVITY LIMITATIONS AND/OR PARTICIPATION RESTRICTIONS; AND CLINICAL DECISION MAKING OF LOW COMPLEXITY, WHICH INCLUDES AN ANALYSIS OF THE OCCUPATIONAL PROFILE, ANALYSIS OF DATA FROM PROBLEM-FOCUSED ASSESSMENT(S), AND CONSIDERATION OF A LIMITED NUMBER OF TREATMENT OPTIONS. PATIENT PRESENTS WITH NO COMORBIDITIES THAT AFFECT OCCUPATIONAL PERFORMANCE. MODIFICATION OF TASKS OR ASSISTANCE (EG, PHYSICAL OR VERBAL) WITH ASSESSMENT(S) IS NOT NECESSARY TO ENABLE COMPLETION OF EVALUATION COMPONENT. TYPICALLY, 30 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97164'',''PT RE-EVAL EST PLAN CARE'',''RE-EVALUATION OF PHYSICAL THERAPY ESTABLISHED PLAN OF CARE, REQUIRING THESE COMPONENTS: AN EXAMINATION INCLUDING A REVIEW OF HISTORY AND USE OF STANDARDIZED TESTS AND MEASURES IS REQUIRED; AND REVISED PLAN OF CARE USING A STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME TYPICALLY, 20 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97163'',''PT EVAL HIGH COMPLEX 45 MIN'',''PHYSICAL THERAPY EVALUATION: HIGH COMPLEXITY, REQUIRING THESE COMPONENTS: A HISTORY OF PRESENT PROBLEM WITH 3 OR MORE PERSONAL FACTORS AND/OR COMORBIDITIES THAT IMPACT THE PLAN OF CARE; AN EXAMINATION OF BODY SYSTEMS USING STANDARDIZED TESTS AND MEASURES ADDRESSING A TOTAL OF 4 OR MORE ELEMENTS FROM ANY OF THE FOLLOWING: BODY STRUCTURES AND FUNCTIONS, ACTIVITY LIMITATIONS, AND/OR PARTICIPATION RESTRICTIONS; A CLINICAL PRESENTATION WITH UNSTABLE AND UNPREDICTABLE CHARACTERISTICS; AND CLINICAL DECISION MAKING OF HIGH COMPLEXITY USING STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME. TYPICALLY, 45 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97162'',''PT EVAL MOD COMPLEX 30 MIN'',''PHYSICAL THERAPY EVALUATION: MODERATE COMPLEXITY, REQUIRING THESE COMPONENTS: A HISTORY OF PRESENT PROBLEM WITH 1-2 PERSONAL FACTORS AND/OR COMORBIDITIES THAT IMPACT THE PLAN OF CARE; AN EXAMINATION OF BODY SYSTEMS USING STANDARDIZED TESTS AND MEASURES IN ADDRESSING A TOTAL OF 3 OR MORE ELEMENTS FROM ANY OF THE FOLLOWING: BODY STRUCTURES AND FUNCTIONS, ACTIVITY LIMITATIONS, AND/OR PARTICIPATION RESTRICTIONS; AN EVOLVING CLINICAL PRESENTATION WITH CHANGING CHARACTERISTICS; AND CLINICAL DECISION MAKING OF MODERATE COMPLEXITY USING STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME. TYPICALLY, 30 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''97161'',''PT EVAL LOW COMPLEX 20 MIN'',''PHYSICAL THERAPY EVALUATION: LOW COMPLEXITY, REQUIRING THESE COMPONENTS: A HISTORY WITH NO PERSONAL FACTORS AND/OR COMORBIDITIES THAT IMPACT THE PLAN OF CARE; AN EXAMINATION OF BODY SYSTEM(S) USING STANDARDIZED TESTS AND MEASURES ADDRESSING 1-2 ELEMENTS FROM ANY OF THE FOLLOWING: BODY STRUCTURES AND FUNCTIONS, ACTIVITY LIMITATIONS, AND/OR PARTICIPATION RESTRICTIONS; A CLINICAL PRESENTATION WITH STABLE AND/OR UNCOMPLICATED CHARACTERISTICS; AND CLINICAL DECISION MAKING OF LOW COMPLEXITY USING STANDARDIZED PATIENT ASSESSMENT INSTRUMENT AND/OR MEASURABLE ASSESSMENT OF FUNCTIONAL OUTCOME. TYPICALLY, 20 MINUTES ARE SPENT FACE-TO-FACE WITH THE PATIENT AND/OR FAMILY.'')';
