EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''81407'',''MOPATH PROCEDURE LEVEL 8'',''MOLECULAR PATHOLOGY PROCEDURE, LEVEL 8 (EG, ANALYSIS OF 26-50 EXONS BY DNA SEQUENCE ANALYSIS, MUTATION SCANNING OR DUPLICATION/DELETION VARIANTS OF >50 EXONS, SEQUENCE ANALYSIS OF MULTIPLE GENES ON ONE PLATFORM) ABCC8 (ATP-BINDING CASSETTE, SUB-FAMILY C [CFTR/MRP], MEMBER 8) (EG, FAMILIAL HYPERINSULINISM), FULL GENE SEQUENCE AGL (AMYLO-ALPHA-1, 6-GLUCOSIDASE, 4-ALPHA-GLUCANOTRANSFERASE) (EG, GLYCOGEN STORAGE DISEASE TYPE III), FULL GENE SEQUENCE AHI1 (ABELSON HELPER INTEGRATION SITE 1) (EG, JOUBERT SYNDROME), FULL GENE SEQUENCE APOB (APOLIPOPROTEIN B) (EG, FAMILIAL HYPERCHOLESTEROLEMIA TYPE B) FULL GENE SEQUENCE ASPM (ASP [ABNORMAL SPINDLE] HOMOLOG, MICROCEPHALY ASSOCIATED [DROSOPHILA]) (EG, PRIMARY MICROCEPHALY), FULL GENE SEQUENCE CHD7 (CHROMODOMAIN HELICASE DNA BINDING PROTEIN 7) (EG, CHARGE SYNDROME), FULL GENE SEQUENCE COL4A4 (COLLAGEN, TYPE IV, ALPHA 4) (EG, ALPORT SYNDROME), FULL GENE SEQUENCE COL4A5 (COLLAGEN, TYPE IV, ALPHA 5) (EG, ALPORT SYNDROME), DUPLICATION/DELETION ANALYSIS COL6A1 (COLLAGEN, TYPE VI, ALPHA 1) (EG, COLLAGEN TYPE VI-RELATED DISORDERS), FULL GENE SEQUENCE COL6A2 (COLLAGEN, TYPE VI, ALPHA 2) (EG, COLLAGEN TYPE VI-RELATED DISORDERS), FULL GENE SEQUENCE COL6A3 (COLLAGEN, TYPE VI, ALPHA 3) (EG, COLLAGEN TYPE VI-RELATED DISORDERS), FULL GENE SEQUENCE CREBBP (CREB BINDING PROTEIN) (EG, RUBINSTEIN-TAYBI SYNDROME), FULL GENE SEQUENCE F8 (COAGULATION FACTOR VIII) (EG, HEMOPHILIA A), FULL GENE SEQUENCE JAG1 (JAGGED 1) (EG, ALAGILLE SYNDROME), FULL GENE SEQUE'')';
