EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''81402'',''MOPATH PROCEDURE LEVEL 3'',''MOLECULAR PATHOLOGY PROCEDURE, LEVEL 3 (EG, >10 SNPS, 2-10 METHYLATED VARIANTS, OR 2-10 SOMATIC VARIANTS [TYPICALLY USING NON-SEQUENCING TARGET VARIANT ANALYSIS], IMMUNOGLOBULIN AND T-CELL RECEPTOR GENE REARRANGEMENTS, DUPLICATION/DELETION VARIANTS OF 1 EXON, LOSS OF HETEROZYGOSITY [LOH], UNIPARENTAL DISOMY [UPD]) CHROMOSOME 1P-/19Q- (EG, GLIAL TUMORS), DELETION ANALYSIS CHROMOSOME 18Q- (EG, D18S55, D18S58, D18S61, D18S64, AND D18S69) (EG, COLON CANCER), ALLELIC IMBALANCE ASSESSMENT (IE, LOSS OF HETEROZYGOSITY) COL1A1/PDGFB (T(17;22)) (EG, DERMATOFIBROSARCOMA PROTUBERANS), TRANSLOCATION ANALYSIS, MULTIPLE BREAKPOINTS, QUALITATIVE, AND QUANTITATIVE, IF PERFORMED CYP21A2 (CYTOCHROME P450, FAMILY 21, SUBFAMILY A, POLYPEPTIDE 2) (EG, CONGENITAL ADRENAL HYPERPLASIA, 21-HYDROXYLASE DEFICIENCY), COMMON VARIANTS (EG, IVS2-13G, P30L, I172N, EXON 6 MUTATION CLUSTER [I235N, V236E, M238K], V281L, L307FFSX6, Q318X, R356W, P453S, G110VFSX21, 30-KB DELETION VARIANT) ESR1/PGR (RECEPTOR 1/PROGESTERONE RECEPTOR) RATIO (EG, BREAST CANCER) MEFV (MEDITERRANEAN FEVER) (EG, FAMILIAL MEDITERRANEAN FEVER), COMMON VARIANTS (EG, E148Q, P369S, F479L, M680I, I692DEL, M694V, M694I, K695R, V726A, A744S, R761H) TRD@ (T CELL ANTIGEN RECEPTOR, DELTA) (EG, LEUKEMIA AND LYMPHOMA), GENE REARRANGEMENT ANALYSIS, EVALUATION TO DETECT ABNORMAL CLONAL POPULATION UNIPARENTAL DISOMY (UPD) (EG, RUSSELL-SILVER SYNDROME, PRADER-WILLI/ANGELMAN SYNDROME), SHORT TANDEM REPEAT (STR) ANALYSIS'')';
EXECUTE 'insert into '|| schema_table ||' values(''BEF2023'',''81401'',''MOPATH PROCEDURE LEVEL 2'',''MOLECULAR PATHOLOGY PROCEDURE, LEVEL 2 (EG, 2-10 SNPS, 1 METHYLATED VARIANT, OR 1 SOMATIC VARIANT [TYPICALLY USING NONSEQUENCING TARGET VARIANT ANALYSIS], OR DETECTION OF A DYNAMIC MUTATION DISORDER/TRIPLET REPEAT) ABCC8 (ATP-BINDING CASSETTE, SUB-FAMILY C [CFTR/MRP], MEMBER 8) (EG, FAMILIAL HYPERINSULINISM), COMMON VARIANTS (EG, C.3898-9G>A [C.3992-9G>A], F1388DEL) ABL1 (ABL PROTO-ONCOGENE 1, NON-RECEPTOR TYROSINE KINASE) (EG, ACQUIRED IMATINIB RESISTANCE), T315I VARIANT ACADM (ACYL-COA DEHYDROGENASE, C-4 TO C-12 STRAIGHT CHAIN, MCAD) (EG, MEDIUM CHAIN ACYL DEHYDROGENASE DEFICIENCY), COMMONS VARIANTS (EG, K304E, Y42H) ADRB2 (ADRENERGIC BETA-2 RECEPTOR SURFACE) (EG, DRUG METABOLISM), COMMON VARIANTS (EG, G16R, Q27E) APOB (APOLIPOPROTEIN B) (EG, FAMILIAL HYPERCHOLESTEROLEMIA TYPE B), COMMON VARIANTS (EG, R3500Q, R3500W) APOE (APOLIPOPROTEIN E) (EG, HYPERLIPOPROTEINEMIA TYPE III, CARDIOVASCULAR DISEASE, ALZHEIMER DISEASE), COMMON VARIANTS (EG, *2, *3, *4) CBFB/MYH11 (INV(16)) (EG, ACUTE MYELOID LEUKEMIA), QUALITATIVE, AND QUANTITATIVE, IF PERFORMED CBS (CYSTATHIONINE-BETA-SYNTHASE) (EG, HOMOCYSTINURIA, CYSTATHIONINE BETA-SYNTHASE DEFICIENCY), COMMON VARIANTS (EG, I278T, G307S) CFH/ARMS2 (COMPLEMENT FACTOR H/AGE-RELATED MACULOPATHY SUSCEPTIBILITY 2) (EG, MACULAR DEGENERATION), COMMON VARIANTS (EG, Y402H [CFH], A69S [ARMS2]) DEK/NUP214 (T(6;9)) (EG, ACUTE MYELOID LEUKEMIA), TRANSLOCATION ANALYSIS, QUALITATIVE, AND QUANTITATIVE, IF PERFORMED E2A/PBX1 (T(1;19)) (EG, ACUTE LYMPHOCYT'')';
